import Foundation
//115. Distinct Subsequences
//Hard
//
//980
//
//49
//
//Add to List
//
//Share
//Given a string S and a string T, count the number of distinct subsequences of S which equals T.
//
//A subsequence of a string is a new string which is formed from the original string by deleting some (can be none) of the characters without disturbing the relative positions of the remaining characters. (ie, "ACE" is a subsequence of "ABCDE" while "AEC" is not).
//
//Example 1:
//
//Input: S = "rabbbit", T = "rabbit"
//Output: 3
//Explanation:
//
//As shown below, there are 3 ways you can generate "rabbit" from S.
//(The caret symbol ^ means the chosen letters)
//
//rabbbit
//^^^^ ^^
//rabbbit
//^^ ^^^^
//rabbbit
//^^^ ^^^
//Example 2:
//
//Input: S = "babgbag", T = "bag"
//Output: 5
//Explanation:
//
//As shown below, there are 5 ways you can generate "bag" from S.
//(The caret symbol ^ means the chosen letters)
//
//babgbag
//^^ ^
//babgbag
//^^    ^
//babgbag
//^    ^^
//babgbag
//  ^  ^^
//babgbag
//    ^^^
//Accepted
//125,111
//Submissions
//338,867
class q0115Solution {
    
    func numDistinct(_ s: String, _ t: String) -> Int {
        NSLog("time 1- step 1")
        let charsS = Array(s)
        let charsT = Array(t)
        let tCount = t.count
        let sCount = s.count

        NSLog("time 1- step 2")

        var dp = [[Int]](repeating: [Int](repeating: 0, count: sCount + 1), count: tCount + 1)
        NSLog("time 1- step 3")

        for i in 0...sCount {
            dp[0][i] = 1
        }
        
        for i in 0..<tCount{
            for j in 0..<sCount {
                if charsT[i] == charsS[j]{
                    dp[i + 1][j + 1] = dp[i + 1][j] + dp[i][j]
                }else{
                    dp[i + 1][j + 1] = dp[i + 1][j]
                }

            }
        }
        NSLog("time 1- step 4")

        return dp[tCount][sCount]
    }
    
    func numDistinct2(_ s: String, _ t: String) -> Int {
        NSLog("time 2- step 1")
        let charsS = Array(s)
        let charsT = Array(t)
        let tCount = t.count
        let sCount = s.count

        NSLog("time 2- step 2")
        var dp = [[Int]](repeating: [Int](repeating: 0, count: tCount + 1), count: sCount + 1)
        NSLog("time 2- step 3")

        for i in 0...sCount {
            dp[i][0] = 1
        }
        
        for i in 0..<sCount{
            for j in 0..<tCount {
                if charsS[i] == charsT[j] {
                    dp[i + 1][j + 1] = dp[i][j + 1] + dp[i][j]
                }else{
                    dp[i + 1][j + 1] = dp[i][j + 1]
                }

            }
        }
        NSLog("time 2- step 4")

        return dp[sCount][tCount]
    }
    
